  selected_mirror = 0;
  lives_left = 2;
  firewall_destroyed = 0;
  bluenode_destroyed = 0;
  for (int i = 0; i < NUM_FIREWALLS; i++) firewall_hit_counter[i] = 0;
  for (int i = 0; i < NUM_NODES; i++) bluenode_hit_counter[i] = 0;
  const node_t firewall_init[NUM_FIREWALLS] = {
      {170, 194}, {235, 108}, {157, 100}, {71, 86}};
  for (int i = 0; i < NUM_FIREWALLS; i++) {
    firewalls[i] = firewall_init[i];
    firewall_hit_counter[i] = 0;
  }

  nodes[0].x = 180;
  nodes[0].y = 105;
  nodes[1].x = 157;
  nodes[1].y = 65;
  nodes[2].x = 73;
  nodes[2].y = 140;
  nodes[3].x = 110;
  nodes[3].y = 81;
  nodes[4].x = 58;
  nodes[4].y = 48;
  nodes[5].x = 170;
  nodes[5].y = 138;

  mirrors[0].angle = 0;
  mirrors[1].angle = 270;
  mirrors[2].angle = 90;
  mirrors[3].angle = 135;
  mirrors[4].angle = 45;
  mirrors[5].angle = 135;
  mirrors[6].angle = 90;
  mirrors[7].angle = 0;
  mirrors[8].angle = 0;
  mirrors[9].angle = 90;
  mirrors[10].angle = 0;
